import React from "react";
import { Container } from "react-bootstrap";
import AreaChartDiagram from "./AreaChartDiagram";
import BarChartDiagram from "./BarChartDiagram";
import BarChart from "./BarChartDiagram";
import LineChartDiagram from "./LineChartDiagram";
import PieChartDiagram from "./PieChartDiagram";

const Charts = () => {
  return (
    <>
      <Container
        fluid
        style={{
          padding: "1.5%",
          paddingTop: "0%",
          paddingBottom: "3%",
        }}
      >
        <div>
          <h5 className="mb-3">Charts In React Js </h5>
        </div>
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Line Chart
        </div>
        <div>
          <LineChartDiagram />
        </div>
        <hr />
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Area Chart
        </div>
        <div>
          <AreaChartDiagram />
        </div>
        <hr />
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Bar Chart
        </div>
        <div>
          <BarChartDiagram />
        </div>
        <hr />
        <div className="text-center text-primary" style={{ fontSize: "48px" }}>
          Pie Chart
        </div>
        <span className="text-center text-primary">
          Programming Languages with it's Student
        </span>
        <div>
          <PieChartDiagram />
        </div>
      </Container>
    </>
  );
};
export default Charts;
